            <a href="badges.html">Components</a>
          </li>
          <li class="active">
            <a href="collapsible.html">JavaScript</a>
          </li>
        </ul>
      </div> */}
    </nav>

    // <div>
    //   <div className="App">
    //     <div>
    //       <Link to="/">Home </Link>
    //     </div>
    //     <div>
    //       <Link to="/InmateList">Inmates</Link>
    //     </div>
    //     <div>
    //       <Link to="/FacilityList">Facilities </Link>
    //     </div>
    //     <div>
    //       <Link to="/Register">Register </Link>
